       var p, pt, leftChain = [], rightChain = [];

       function areBothTypedAs (type) {
           return typeof x === type && typeof y === type;
       }

       function areBothInstancesOf (instance) {
           return x instanceof instance && y instanceof instance;
       }

       function areBothInstancesOfSimpleTypes () {
           return areBothTypedAs('function') ||
               areBothInstancesOf(Date) ||
               areBothInstancesOf(RegExp) ||
               areBothInstancesOf(String) ||
               areBothInstancesOf(Number);
       }

       if (/*arguments.length !== 2 || */x === y || isNaN(x) && isNaN(y) && areBothTypedAs('number')) {
           return true;
       }

       if (areBothInstancesOfSimpleTypes()) {
           return x.toString() === y.toString();
       }

       if (!areBothInstancesOf(Object) ||
           (x.isPrototypeOf(y) || y.isPrototypeOf(x)) ||
           (x.constructor !== y.constructor || x.prototype !== y.prototype)) {
           return false;
       }

       // Check for infinitive linking loops
       if (leftChain.indexOf(x) > -1 || rightChain.indexOf(y) > -1) {
           return false;
       }

       for (p in y) {
           if (y.hasOwnProperty(p) !== x.hasOwnProperty(p) || typeof y[p] !== typeof x[p]) {
               return false;
           }
       }

       /*eslint-disable guard-for-in*/
